import React from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import { doLogout } from "../store/actions/signinAction";

class Header extends React.Component {
  changeRouter = async (category) => {
    if (this.props.handleRouter) {
      this.props.handleRouter(category);
    } else {
      await this.props.history.replace("/movies-category/" + category);
    }
  };

  render() {
    return (
      <div>
        <nav
          className="navbar navbar-expand-lg navbar-light"
          style={{
            backgroundColor: "AliceBlue",
          }}
        >
          <Link
            to="#"
            className="navbar-brand"
            value=""
            onClick={() => this.props.history.push("/")}
          >
            <img
              src={require("../media/logo192.png")}
              className="navbar-brand App-logo"
            />
          </Link>
          <Link
            to="#"
            className="nama-brand my-lg-4 mr-lg-2"
            value=""
            onClick={() => this.props.history.push("/")}
          >
            <h2 style={{ color: "DarkBlue" }}>Movie</h2>
          </Link>

          <button
            className="navbar-toggler"
            type="button"
            data-toggle="collapse"
            data-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>

          <div
            style={{
              fontWeight: "bolder",
            }}
            className="collapse navbar-collapse"
            id="navbarSupportedContent"
          >
            <ul className="navbar-nav mr-auto">
              <li className="nav-item ">
                <Link className="nav-link" to="/">
                  {" "}
                  Home <span className="sr-only">(current)</span>
                </Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/profile">
                  {" "}
                  Profile <span className="sr-only">(current)</span>
                </Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/signin">
                  {" "}
                  Login <span className="sr-only">(current)</span>
                </Link>
              </li>
            </ul>
          </div>
        </nav>
      </div>
    );
  }
}

export default Header;
